import React from 'react'

import { faQuoteLeft } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

function QuoteItem( props) {
    console.log(props)
    const {quote, author, color } = props.data;
    console.log(quote)
  return (
    <div id='quote-and-author-container'>
        <div className="quote-item">
        <FontAwesomeIcon icon={faQuoteLeft} className="icon flipcolortext" style={ { color}}/>
       
        <p id='text'  style={{ color: color}}>{quote}</p>
        </div>
        <small id='author'  style={{ color: color}}>-{author} </small>
    </div>
  )
}

export default QuoteItem
